import React, { Component } from 'react'

class Question extends Component {
  state = {
    question: "Hello World?",
    options: ["1", "2", "3"],
  }

  render () {
    return (
      <div>
        <span>{this.state.question}</span> 
        <br />
        { this.state.options.map( option => <button id={ option }>{ option }</button> ) }
      </div>
    )
  }
}

export default Question
